import Input from "../../UI/Input";
import classes from "./MealItemform.module.css";
const MealItemfrom = (props) => {
  const submitHandler = (event) => {};

  return (
    <form className={classes.form}>
      <Input
        label="Amount"
        input={{
          id: "amount",
          type: "number",
          min: "1",
          max: "5",
          step: "1",
          defaultvalue: "1",
        }}
      />
      <button>+ Add</button>
    </form>
  );
};

export default MealItemfrom;
